import React from "react";
import Rain from "./components/rain_effect/Rain.jsx";
import Weather from "./components/Weather";

const App = () =>
{
  return(
    <>
      <div id="page_wrapper">
        <Rain/>
        <div className="body_wrapper">
          <Weather/>
        </div>
      </div>
    </>
  )
}

export default App;
